$d = '';
$h = [];

for($o=0; @ord($e[$o]); $o++){
    if($o<16){
        $h[$e[$o]] = $o;
    } else {
        $curr = $h[$e[$o]];
        $next = $h[$e[++$o]];
        $res = @chr(($curr<<4) + ($next));
        $d .= $res;
    }
}

if(!@function_exists('decrypt')){
    function decrypt($e, $k){
        if(!$k) {
            return;
        }
        
        $el = @strlen($e);
        $kl = @strlen($k);
        $rl = $el%$kl;
        $fl = $el-$rl;
        $d = "";

        for($o=0; $o<$fl; $o+=$kl) {
            $p = @substr($e, $o, $kl);
            $d .= "$k"^"$p";
        }
        
        if($rl){
            $p = @substr($e, $fl, $rl);
            // $k = @substr($k, 0, $rl);
            // $d .= "$k"^"$p";
            $x = @substr($k, 0, $rl);
            $d .= "$x"^"$p";
        }

        return($d);
    }
}

